script: |
  super -f tsv -I q432.sql | sort > q432.out

vector: true

inputs:
  - name: q432.sql
    data: |
      SELECT DISTINCT + 93 AS col0 FROM tab2 AS cor0 WHERE 97 + + + ( col1 ) / - col0 + - col1 * CAST ( col1 AS INTEGER ) NOT IN ( - col2 * col2 - + 90 * col1 );
  - name: tab2

outputs:
  - name: q432.out
    data: |
      93
